import logo from './logo.svg';
import './App.css';

function App() {
  const title = 'welcome to the new blog';

  return (
    <div className="App">
      <div className="content">
        <h1>{title} <img src={logo}></img></h1>
      </div>
    </div>
  );

}

export default App;
